import axios from 'axios';

async function mongodbRetrieve(playerType) {
    const requestObj = {
        'playerType': playerType
    }
    console.log(requestObj);
    const response = await axios.post('http://localhost:5000/mongodb-players/retrieve');
    console.log(response);
}

export default mongodbRetrieve;
